import type { LatLngTuple } from 'leaflet'
import L from 'leaflet'
import { MapContainer, Marker, Popup, TileLayer } from 'react-leaflet'
import { useCarStore } from '../store/useCarStore'

const position: LatLngTuple = [24.75, 55] // Default position

const icon = L.icon({
   iconUrl:
      'data:image/png;base64,',
   iconSize: [70, 70],
   iconAnchor: [17, 46],
   popupAnchor: [0, -46],
})

export default function App() {
   const { availableCars, cars } = useCarStore((state) => state)

   return (
      <MapContainer center={position} zoom={9}>
         <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
         />
         {availableCars.map((carId) => {
            const { id, model, location } = cars[carId]
            return (
               <Marker position={[location.lat, location.lng]} key={id} icon={icon}>
                  <Popup>
                     {model} <br />
                  </Popup>
               </Marker>
            )
         })}
      </MapContainer>
   )
}
